import React from "react";
import { useAlertToggle } from "./alert/alertContext";

const Main = ({ toggleAlert, ...props }) => {
    useAlertToggle()
    return (
        <>
            <h1>Привет приммер контектс</h1>
            <button onClick={toggleAlert}>{props.alert ? 'скрыть алерт' : 'показать алерт'}</button>
        </>
    )
}




export default Main
